import img from "./img/2.png"
function App() {
  return (
    <>
    <nav className="navbar navbar-dark navcol shadow p-3 mb-5 bg-body rounded">
    <div className="container-fluid">
    <div className="d-flex me-4 welcome">
      Welcome!
    </div>
    <div className="d-flex me-4 lab-title text-uppercase">
      Lab Reservation
    </div>
    <a className="navbar-brand"><img src={img} alt="" /></a>

  </div>

</nav>

    </>
  );
}

export default App;
